import React from "react";
import "./style.css";

const MentorCreateProfile = () => {
  return (
    <>
      <div class="container">
        <h1>    Create Profile</h1>
      <img src="/avatar.png" alt="female profile" />
    
      <form>
        <label>
          First Name:
          <input type="text" name="name" />
        </label>
        <label>
          Last Name:
          <input type="text" name="name" />
        </label>
      </form>
      </div>
    </>
  );
};

export default MentorCreateProfile;
